import React from "react";
import Form from 'react-bootstrap/Form';

function Login(){

    return <Form>
        <Row lg={5}>
            <Form.Group class="loginField">
                <Form.Control placeholder="Username"></Form.Control>
            </Form.Group>
        </Row>

        <Form.Control placeholder="Password"></Form.Control>
    </Form>;

}

export default Login;
